import { useState } from 'react'
import './index.css'
import 'react-bootstrap'

function Check(props) {
    let texto = props.texto
    const [valor,SetValor] = useState('')
    function mudarValor(evento){
        SetValor(evento.target.value)
        console.log(valor)
    }
    return (
        <div className='geral'>
            <div className="form-check form-switch">
                <input className="form-check-input" is={mudarValor} type="checkbox" id="flexSwitchCheckDefault" />
                <label className="form-check-label" htmlFor="flexSwitchCheckDefault">{texto}</label>
            </div>
        </div>
    )
}

export default Check
